import React, {Component} from 'react'


class One extends Component{
    constructor(props){
        super(props)
        this.state = {rating: ''}
    }
    render(){

        const low = function(){
            this.setState({rating: 'low'})
        }
        const medium = function(){
            this.setState({rating: 'medium'})
        }
        const high = function(){
            this.setState({rating: 'high'})
        }

        return(
            <div>
                <p>this is ONE</p>
                <button onClick={low}>low</button>
                <button onClick={medium}>medium</button>
                <button onClick={high}>high</button>
                <p>the state is ${this.state.rating}</p>
            </div>
        )
    }
}

export default One;
